import React, { Component } from 'react'
import { HashRouter as Router, Route, Link } from 'react-router-dom';
import App from './App';
import Login from './pages/login/index';
import Home from './pages/home/home';
import CpChannelBind from './pages/cpchannelbind/index';
import CpManage from './pages/cpmanage/index';
import CpChannelQuery from './pages/cpchannelquery/index';
import DsManage from './pages/dsmanage/indes';
import Permission from './pages/permission/index';
import NoMatch from './pages/nomatch/index';
import Admin from './admin'

export default class IRouter extends Component{
    render(){
        return (
            <Router>
                    <App>
                    <Switch>
                        <Route path="/login" component={Login}/>

                        <Route path="/" render={()=>
                            <Admin>
                                <Switch>
                                    <Route path="/home" component={Home} />
                                    <Route path="/cpchannelbind" component={CpChannelBind} />
                                    <Route path="/cpmanage" component={CpManage} />
                                    <Route path="/cpchannelquery" component={CpChannelQuery} />
                                    <Route path="/dsmanage" component={DsManage} />
                                    <Route path="/permission" component={Permission} />
                                    <Redirect to="/home" />
                                    <Route component={NoMatch} />
                                </Switch>
                            </Admin>         
                        } />
                    </Switch>

                    </App>
            </Router>
        );
    }
}
